import { Col, Container, Row, Form, Button} from "react-bootstrap";

function Manage()
{
    return(
        <div>
            <Container>
                <Row>
                    <Col>
                        <h2>Dodaj restaurację</h2>

                            <Form.Group className="mb-3" controlId="manageRestaurant">
                                <Form.Label className="float-start">Nazwa restauracji</Form.Label>
                                <Form.Control type="input"  placeholder="Wprowadź nazwe" />
                            </Form.Group>

                    </Col>
                </Row>
            </Container> 
        </div>
    )
}

export default Manage
